import React from 'react'
import Keto from '../assets/images/keto.png'
export default function Footer() {
    return (
        <div className='w-full h-1/2 bg-red-400 flex'>
            <div className='w-1/4 h-full bg-blue-200 flex flex-col  items-center justify-center text-white'>
            <img src={Keto} alt="Logo" className='w-20'/>
            <div className='h-4 border-l-2'></div>
            <i className="fas fa-phone cursor-pointer"><span className='ml-2'>000-0000</span></i>
            </div>


        </div>
    )
}
